DROP FUNCTION IF EXISTS createSkillEnchant;
DROP FUNCTION IF EXISTS createSkillEnchant2;
DROP FUNCTION IF EXISTS deleteSkillEnchant;

SET GLOBAL log_bin_trust_function_creators = 1;

delimiter //
CREATE FUNCTION createSkillEnchant(skillId INT, enchantType INT, baseLvl INT)
	RETURNS TEXT
	NOT DETERMINISTIC
	MODIFIES SQL DATA
	SQL SECURITY INVOKER
BEGIN
	SET @SKILL_ID = skillId;
	SET @ENCHANT_TYPE = enchantType;
	SET @BASE_LVL = baseLvl;
	
	/* creates the route */
		SELECT
			@SKILL_ID,
			@ENCHANT_TYPE * 100 + (`level` % 100),
			@BASE_LVL,
			`sp`,
			`exp`,
			IF ((`level` % 100) = 1, @BASE_LVL, @ENCHANT_TYPE * 100 + (`level` % 100) - 1),
			`success_rate76`,
			`success_rate77`,
			`success_rate78`,
			`success_rate79`,
			`success_rate80`,
			`success_rate81`,
			`success_rate82`,
			`success_rate83`,
			`success_rate84`,
			`success_rate85`
		FROM
			`enchant_skill_trees`
		WHERE
			`skill_id` = 1
		AND
			CAST(`level` / 100 AS SIGNED) = 1;
	
	/* sets the base level to be the same with the +1 enchant1 */
	UPDATE `enchant_skill_trees` AS `t1`, `enchant_skill_trees` AS `t2`
		SET
			`t1`.`base_lvl` = `t2`.`base_lvl`
		WHERE
			`t1`.`skill_id` = @SKILL_ID
		AND
			`t2`.`skill_id` = @SKILL_ID AND `t2`.`level` = 101;
	
	/* sets the base level as the minimum required skill level for the +1 enchant */
	UPDATE `enchant_skill_trees`
		SET
			`min_skill_lvl` = `base_lvl`
		WHERE
			`skill_id` = @SKILL_ID AND `level` = @ENCHANT_TYPE * 100 + 1;
	
	RETURN "Done.";
END//

CREATE FUNCTION createSkillEnchant2(skillId INT, enchantType INT)
	RETURNS TEXT
	NOT DETERMINISTIC
	MODIFIES SQL DATA
	SQL SECURITY INVOKER
BEGIN
	SET @SKILL_ID = skillId;
	SET @ENCHANT_TYPE = enchantType;
	
	RETURN createSkillEnchant(@SKILL_ID, @ENCHANT_TYPE, 0);
END//

CREATE FUNCTION deleteSkillEnchant(skillId INT, enchantType INT)
	RETURNS TEXT
	NOT DETERMINISTIC
	MODIFIES SQL DATA
	SQL SECURITY INVOKER
BEGIN
	SET @SKILL_ID = skillId;
	SET @ENCHANT_TYPE = enchantType;
	
	/* deletes the route */
	DELETE FROM `enchant_skill_trees`
		WHERE
			`skill_id` = @SKILL_ID
		AND
			CAST(`level` / 100 AS SIGNED) = @ENCHANT_TYPE;
	
	RETURN "Done.";
END//
